import PlayIcon from "./PlayIcon"

const PlayButton = ({displayMenu, play, gamStarted}) => {
    return (
        <>
        { (!displayMenu && gam) &&
        <> 
            <div className='playBtnContainer'> </div>
            <div className='playBtn' onClick={play}><PlayIcon /></div>
        </>
        }
        </>
    )
}

export default PlayButton
